{
  "name": "UBX-NAV-TIMENAVIC",
  "class_id": "0x01",
  "message_id": "0x63",
  "message_type": "periodic_polled",
  "comment": "This message reports the precise NavIC time of the most recent navigation solution including validity flags and an accuracy estimate.",
  "payload_length": {
    "fixed": 20
  },
  "fields": [
    {
      "byte_offset": 0,
      "name": "iTOW",
      "data_type": "U4",
      "unit": "ms",
      "description": "GPS time of week of the navigation epoch. See section iTOW timestamps in the integration manual for details."
    },
    {
      "byte_offset": 4,
      "name": "NavICTow",
      "data_type": "U4",
      "unit": "s",
      "description": "NavIC time of week (rounded to seconds)"
    },
    {
      "byte_offset": 8,
      "name": "fNavICTow",
      "data_type": "I4",
      "unit": "ns",
      "description": "Fractional part of the NavIC time of week (range: +/-500000000). The precise NavIC time of week in seconds is: NavICTow + fNavICTow * 1e-9"
    },
    {
      "byte_offset": 12,
      "name": "reserved0",
      "data_type": {
        "array_of": "U1",
        "count": 8
      },
      "reserved": true
    }
  ]
}
